import React, { useState, useEffect } from "react";
import Monitor from "./Monitor";
import "./Machine.css";
import { Velocity } from "../../../Services/Velocity";

function Machine(props) {
  const [showPopup, setShowPopup] = useState(false); // State variable for pop-up visibility
  const [apiData, setApiData] = useState([]); // State variable for API data

  useEffect(() => {
    // Function to fetch API data
    const fetchData = async () => {
      try {
        const response = await Velocity();
        setApiData(response);
      } catch (error) {
        console.log(error);
      }
    };

    // Fetch API data initially
    fetchData();

    // Fetch API data every 30 seconds
    const interval = setInterval(fetchData, 30000);

    // Clean up the interval when the component is unmounted
    return () => clearInterval(interval);
  }, []);

  const getVelocity = async (id) => {
    const response = await Velocity();
    const filteredData = response.filter((ele) => ele.id === id);
    if (filteredData.length > 0) {
      setApiData(filteredData[0]);
    }
  };

  const handleInfoClick = (id) => {
    getVelocity(id);
    setShowPopup(true);
  };

  const closePopup = () => {
    setShowPopup(false);
  };

  return (
    <div className="machines">
      <div>
        <h4 style={{ color: "black", backgroundColor: "rgb(255, 193, 7)" }}>{props.machine.name}</h4>
        <div className="signals">
          {props.machine.monitors.map((monitor) => (
            <Monitor key={monitor.id} monitor={monitor} />
          ))}
        </div>
        <h4>HS {props.machine.healthScore}</h4>
        <div className="info-icon" onClick={() => handleInfoClick(props.machine.id)}>
          &#x1F6C8;
        </div>
      </div>

      {showPopup && (
        <div className="popup">
          <div className="popup-content">
            <h2>{apiData.name}</h2>
            <div className="tableWrapper">
              <table>
                <thead>
                  <tr>
                    <th>Monitor Name</th>
                    <th>Axi</th>
                    <th>Ver</th>
                    <th>Hor</th>
                    <th>tem</th>
                    <th>HS</th>
                    <th>Vibration Trend</th>
                  </tr>
                </thead>
                <tbody>
                  {apiData.monitors.map((data) => (
                    <tr key={data.id}>
                      <td>{data.name}</td>
                      <td>{data.velocityX}</td>
                      <td>{data.velocityY}</td>
                      <td>{data.velocityZ}</td>
                      <td>{data.temperature}</td>
                      <td>{data.healthScore}%</td>
                      <td>{data.trend}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
            <center>
              <a href="https://idap.infinite-uptime.com/#/dashboard/MonitoringTable" target="_blank" rel="noopener noreferrer">
                For Detailed Analysis Click Here!
              </a>
            </center>
            <b>Observation</b>: {apiData.observation}<br /><br />
            <b>Diagnostic</b>: {apiData.diagnostic}<br /><br />
            <b>Recommendation</b>: {apiData.recommendation}<br /><br />
            <button className="close-btn" onClick={closePopup}>Close</button>
          </div>
        </div>
      )}
    </div>
  );
}

export default Machine;
